import React from "react";
import './Footer.css';

const Footer = () => {
  return (
    <div className='body'>
      <footer className="pv4 ph3 ph5-ns tc" />
      <a
        className="link near-black hover-silver dib h2 w2 mr3"
        href="https://facebook.com"
        title="Facebook"
      >
      </a>
    </div>
  );
};

export default Footer;
